            <div class="container" style={{margin:"10rem"}}>

                <Table striped bordered hover size="sm" >
                    <thead>
                       <tr>
                        <td>Name</td>
                        <td>age</td>
                       </tr>
                   </thead>
                   <tbody>
                    {
                        ls && ls.length > 0 ? ls.map((item) => { 
                            return(
                                <tr>
                                    <td>{item.name}</td>
                                    <td>{item.age}</td>

                                </tr>

                            )

                        }) : " NO data Available "
                    }
                   </tbody>


                </Table>




            </div>


    )



}

export default Home;
